import React from 'react'
import './AllScenarios.css'

const AllScenarios = () => {
  return (
    <div className='container'><button className='btnadd'>Add</button><button className='btnreset'>Reset</button>&nbsp;&nbsp;&nbsp;&nbsp;<button className='btngoback'>Go Back</button><div className='btn'></div></div>
  )
}

export default AllScenarios
